import React from "react";
import gLogo from "../../img/hd.png";
import { Link } from "react-router-dom";

const logo = props => (
  <div className='Logo'>
    <img src={gLogo} alt='GUARDIAN' />

    <Link to='/'>
      <i className='fas fa-code' />
      GUARDIAN Command and Control
    </Link>
  </div>
);
export default logo;
